import React from 'react';
import './Deals.css';

const deals = [
  { code: 'DIWALI25', type: 'Percentage', value: '25%', expires: '2025-11-01', usage: 124 },
  { code: 'NEWUSER500', type: 'Flat', value: '₹500', expires: '2026-01-01', usage: 402 },
];

export default function Deals() {
  return (
    <div className="page deals-page">
      <h2>Deals & Discounts</h2>
      <table className="table">
        <thead><tr><th>Code</th><th>Type</th><th>Value</th><th>Expires</th><th>Usage</th></tr></thead>
        <tbody>
          {deals.map(d => (
            <tr key={d.code}>
              <td>{d.code}</td><td>{d.type}</td><td>{d.value}</td><td>{d.expires}</td><td>{d.usage}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
